f248a142657385f17eb0dfbc2a0a16766f267662:
query FullTextSearchQuery($first: Int!, $after: String, $sort: StoreSort, $term: String!, $selectedFacets: [StoreSelectedFacet!]!) {
  search(
    first: $first
    after: $after
    sort: $sort
    term: $term
    selectedFacets: $selectedFacets
  ) {
    products {
      pageInfo {
        totalCount
      }
      edges {
        node {
          id: productID
          slug
          name
          sku
          image {
            url
            alternateName
          }
        }
      }
    }
    facets {
      key
      label
      type
      values {
        label
        value
        selected
        quantity
      }
    }
  }
}

